import {Link} from 'react-router-dom';

const Navbar = () => {
    return ( 
        <header>
            <div className="container">
                <Link to= "/">
                    <h1>TODOS</h1>
                </Link>
                <nav>
                    <div>
                        <Link to = "/lgo"></Link>
                    </div>
                </nav>
                <h2>Never miss a thing</h2>
            </div>
        </header>
     );
}
 
export default Navbar;
